import React, { useState } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [activeMenu, setActiveMenu] = useState(null);

  const toggleMenu = (menu) => {
    if (activeMenu === menu) {
      setActiveMenu(null);
    } else {
      setActiveMenu(menu);
    }
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src="logo.png" alt="Logo" />
      </div>
      <div className="navbar-menu">
        {['Product', 'About', 'Resources', 'Pricing'].map((item) => (
          <div className="menu-item" key={item}>
            <a href={`#${item.toLowerCase()}`}>{item}</a>
            <span
              className="menu-arrow"
              onClick={() => toggleMenu(item)}
            >
              {activeMenu === item ? '▲' : '▼'}
            </span>
            {activeMenu === item && (
              <div className="submenu">
                <div className="submenu-part">Part 1 Content</div>
                <div className="submenu-part">Part 2 Content</div>
                <div className="submenu-part">Part 3 Content</div>
              </div>
            )}
          </div>
        ))}
      </div>
      <div className="navbar-buttons">
        <button className="cta-button login-button">Login</button>
        <button className="cta-button sales-button">Talk to Sales</button>
        <button className="cta-button get-started-button">Get Started Free</button>
      </div>
      <div className="navbar-toggle" onClick={() => setIsOpen(!isOpen)}>
        <span className="toggle-bar"></span>
        <span className="toggle-bar"></span>
        <span className="toggle-bar"></span>
      </div>
    </nav>
  );
};

export default Navbar;
